import React from 'react';

const AdvancedChat = () => (
  <div className="space-y-6">
    <div className="mb-6">
      <h3 className="text-2xl font-semibold text-gray-900 mb-2">Advanced Chat</h3>
      <p className="text-sm text-gray-500 uppercase tracking-wider">AI-powered medical consultation</p>
    </div>
    <p className="text-gray-600 leading-relaxed">
      Get comprehensive medical insights with our advanced AI assistant. Discuss
      symptoms, medications, and receive detailed health guidance.
    </p>
    <div className="flex gap-6 text-sm text-gray-500">
      <span>AI-Powered</span>
      <span>Secure</span>
    </div>
    <button className="w-full bg-gray-900 text-white py-4 px-6 rounded-lg font-medium hover:bg-gray-800 transition-colors duration-200">
      Start Advanced Chat
    </button>
  </div>
);

const BasicChat = () => (
  <div className="space-y-6">
    <div className="mb-6">
      <h3 className="text-2xl font-semibold text-gray-900 mb-2">Basic Chat</h3>
      <p className="text-sm text-gray-500 uppercase tracking-wider">Quick health questions & answers</p>
    </div>
    <p className="text-gray-600 leading-relaxed">
      Quick and simple health consultations for everyday questions. Perfect for
      basic symptoms, general wellness, and health tips.
    </p>
    <div className="flex gap-6 text-sm text-gray-500">
      <span>Fast Response</span>
      <span>Easy to Use</span>
    </div>
    <button className="w-full bg-gray-900 text-white py-4 px-6 rounded-lg font-medium hover:bg-gray-800 transition-colors duration-200">
      Start Basic Chat
    </button>
  </div>
);

const ReportAssistant = () => (
  <div className="space-y-6">
    <div className="mb-6">
      <h3 className="text-2xl font-semibold text-gray-900 mb-2">Report Assistant</h3>
      <p className="text-sm text-gray-500 uppercase tracking-wider">Medical report analysis & insights</p>
    </div>
    <p className="text-gray-600 leading-relaxed">
      Upload and analyze medical reports, lab results, and diagnostic images. Get
      clear explanations and actionable insights.
    </p>
    <div className="flex gap-6 text-sm text-gray-500">
      <span>Report Analysis</span>
      <span>Confidential</span>
    </div>
    <button className="w-full bg-gray-900 text-white py-4 px-6 rounded-lg font-medium hover:bg-gray-800 transition-colors duration-200">
      Analyze Reports
    </button>
  </div>
);

function App() {
  const [hoveredCard, setHoveredCard] = React.useState(null);
  const [isLoaded, setIsLoaded] = React.useState(false);

  React.useEffect(() => {
    setIsLoaded(true);
  }, []);

  const components = [
    { component: <AdvancedChat /> },
    { component: <BasicChat /> },
    { component: <ReportAssistant /> },
  ];

  return (
    <div className="min-h-screen bg-white">
      <div className="container mx-auto px-6 py-16">
        {/* Header */}
        <div
          className={`text-center mb-20 transition-all duration-1000 ${
            isLoaded ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-8'
          }`}
        >
          <h1 className="text-6xl font-light bg-gradient-to-r from-blue-600 via-green-600 to-purple-600 bg-clip-text text-transparent mb-6">
            MediBot
          </h1>
          <p className="text-xl text-gray-500 max-w-2xl mx-auto leading-relaxed font-light">
            Your intelligent healthcare companion providing personalized medical
            guidance and support
          </p>

          {/* Trust Indicators */}
          <div className="flex items-center justify-center gap-12 mt-12 text-sm text-gray-400 uppercase tracking-wider">
            <span>HIPAA Compliant</span>
            <span>AI-Powered</span>
            <span>24/7 Available</span>
          </div>
        </div>

        {/* Service Cards */}
        <div className="grid lg:grid-cols-3 gap-8 max-w-5xl mx-auto">
          {components.map((item, index) => (
            <div
              key={index}
              className={`group relative bg-white border border-gray-100 rounded-lg p-10 transition-all duration-300 ${
                hoveredCard === index
                  ? 'shadow-xl border-gray-200 transform -translate-y-1'
                  : 'hover:shadow-lg hover:border-gray-150'
              } ${
                isLoaded ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-12'
              }`}
              style={{
                transitionDelay: `${index * 150}ms`,
              }}
              onMouseEnter={() => setHoveredCard(index)}
              onMouseLeave={() => setHoveredCard(null)}
            >
              <div className="relative z-10">{item.component}</div>
            </div>
          ))}
        </div>

        {/* Footer */}
        <footer
          className={`text-center mt-24 transition-all duration-1000 delay-700 ${
            isLoaded ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
          }`}
        >
          <div className="text-gray-500 mb-4">
            <span className="font-light">
              Trusted by healthcare professionals worldwide
            </span>
          </div>
          <p className="text-gray-400 text-sm font-light">
            &copy; 2025 MediBot. All rights reserved.
            <span className="mx-4">|</span>
            <span className="text-gray-600 hover:text-gray-900 cursor-pointer transition-colors">
              Privacy Policy
            </span>
            <span className="mx-4">|</span>
            <span className="text-gray-600 hover:text-gray-900 cursor-pointer transition-colors">
              Terms of Service
            </span>
          </p>
        </footer>
      </div>
    </div>
  );
}

export default App;
